import React, { Component, useState } from 'react';
import { connect } from 'react-redux';
import logo from './logo.svg';
import './App.css';
import {fetchShips} from './actions/shipActions';

class App extends Component {
	render() {
		const [selected, setSelected] = useState('');
		const {ships} = this.props.data;
		return (
			<div className="App">
				<pre>{JSON.stringify(this.props)}</pre>

				<button onClick={this.props.fetchShips}>Fetch Ships</button>
				 <h2>
	                List of Ships
	            </h2>
	            <ul>
	                {ships && ships.map(ship => (
	                	<li
	                		key={ship.id}
	                		onClick={() => setSelected(ship.id)}>
	                			{JSON.stringify(ship, null, 2)}
	                	</li>
	                ))}
	            </ul>
			</div>
		);
	}
}

const mapStateToProps = state => ({
	...state
})

const mapDispatchToProps = dispatch => ({
	fetchShips: () => dispatch(fetchShips())
})

export default connect(mapStateToProps, mapDispatchToProps)(App);
